import axios from "axios";

export class CustomerService{

    baseUrl = "http://localhost:8080/api/v1/customer/"

    getCustomer(email){
        return axios.get(this.baseUrl + email).then( res => {console.log(Object.keys(res.data).length)});
    }
}
